import { TextArea as BaseTextArea, } from "@microsoft/fast-components-react-base";
import textAreaSchema from "./text-area.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { TextAreaStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const TextArea = manageJss(TextAreaStyles)(BaseTextArea);
export { TextArea, textAreaSchema, };
